import React from 'react'
import './style.scss';

function Nav(Props) {
    return (
        <nav className="navbar">
            <h1>Novo Guitar Guessing Game</h1>
            <h2>{`${this.props.headingText} ${this.props.headingValue}`}</h2>
        </nav>
    )
}

export default Nav;
